    /**
     * Test of errorDelta method, of class MinErrorSurjection.
     */
    @Test
    public void testErrorDelta() {
        System.out.println("errorDelta");
        final SparseIntArray x = SparseIntArray.fromArray(new int[]{1, 2, 3, 4, 5});
        final SparseIntArray y = SparseIntArray.fromArray(new int[]{3, 1, 2, 2, 3});
        double a = 5.0 / 3.0;
        double expResult = 15.0 - 16.0 / 3.0;
        double result = MinErrorSurjection.errorDelta(x, y, a);
        assertEquals(expResult, result, 0.0);
    }

    /**
     * Test of minError method, of class MinErrorSurjection.
     */
    @Test
    public void testMinError() {
        System.err.println("minError");
        final SparseIntArray x = SparseIntArray.fromArray(new int[]{1, 2, 3, 4, 5});
        final SparseIntArray y = SparseIntArray.fromArray(new int[]{3, 1, 2, 2, 3});
        double result = MinErrorSurjection.minError(x, y,5);
        assertEquals(5.0 / 3.0, result, 0.01);
    }

    @Test
    public void testMinErrorRand() {
        final Random random = new Random();
        for (int i = 0; i < 10; i++) {
            final SparseIntArray x = new SparseIntArray(10);
            final SparseIntArray y = new SparseIntArray(10);
            for (int j = 0; j < 10; j++) {
                final int n = random.nextInt(10) - 4;
                if (n > 0) {
                    x.put(j, n);
                }
                final int m = random.nextInt(10) - 4;
                if (m > 0) {
                    y.put(j, m);
                }
            }
            final HashSet<Integer> intersection = new HashSet<Integer>(x.keySet());
            intersection.retainAll(y.keySet());
            if (intersection.isEmpty()) {
                i--;
                continue;
            }
            final double minError = MinErrorSurjection.minError(x, y,5);
            assertFalse(Double.isNaN(minError));
        }

    }

